// src/App.jsx
import React from 'react';
import Navbar from './components/Navbar';
import Footer from './components/Footer';


const App = () => {
  return (
    <div>
      <Navbar />

      {/* Main Landing Page Content */}
      <main style={styles.main}>
        <h1>Welcome to HealthScreen</h1>
        <p>Prevention is the smarter way to stay healthy and happy.</p>
        {/* Replace with <LandingPage /> once it's built */}
      </main>

      <Footer />
    </div>
  );
};

const styles = {
  main: {
    padding: '2rem',
    textAlign: 'center',
  },
};

export default App;
